import XCTest
@testable import GCRSearch


class IndexParserTests: XCTestCase {

    func testExample() throws {
        let content = String(data: Data(base64Encoded: IndexParserTests.content)!, encoding: .utf8)!
        let result = IndexParser().parse(content: content)
        XCTAssertEqual(result.expectedRowCount, 100)
        XCTAssertEqual(result.rows.count, 100)
    }

    static var allTests = [
        ("testExample", testExample),
    ]

}


